import React from "react";

function Content (props){
    return (
        <div className="term">
          <div>
            <span className="work" role="img" aria-label="Tense Biceps">
              {props.gameTitle}
            </span>
            <span>{props.name}</span>
          </div>
          <dd>{props.description}</dd>
        </div>
      );
}

export default Content;
